import NavBar from '../NavBar/NavBar';
import './Index.css';

class Index extends Component {
    state = {
        loggedIn: false
    };
    render() {
        return (
            <div style= {{backgroundColor: rgb}}>
                <NavBar/>
            </div>
        );
    }
}

export default Index;
